2:8890:3266.docs:
'Zips up' two iterators into a single iterator of pairs.

`zip()` returns a new iterator that will iterate over two other
iterators, returning a tuple where the first element comes from the
first iterator, and the second element comes from the second iterator.

In other words, it zips two iterators together, into a single one.

If either iterator returns [`None`], [`next`] from the zipped iterator
will return [`None`].
If the zipped iterator has no more elements to return then each further attempt to advance
it will first try to advance the first iterator at most one time and if it still yielded an item
try to advance the second iterator at most one time.

To 'undo' the result of zipping up two iterators, see [`unzip`].

[`unzip`]: Iterator::unzip

# Examples

Basic usage:

```
let a1 = [1, 2, 3];
let a2 = [4, 5, 6];

let mut iter = a1.iter().zip(a2.iter());

assert_eq!(iter.next(), Some((&1, &4)));
assert_eq!(iter.next(), Some((&2, &5)));
assert_eq!(iter.next(), Some((&3, &6)));
assert_eq!(iter.next(), None);
```

Since the argument to `zip()` uses [`IntoIterator`], we can pass
anything that can be converted into an [`Iterator`], not just an
[`Iterator`] itself. For example, slices (`&[T]`) implement
[`IntoIterator`], and so can be passed to `zip()` directly:

```
let s1 = &[1, 2, 3];
let s2 = &[4, 5, 6];

let mut iter = s1.iter().zip(s2);

assert_eq!(iter.next(), Some((&1, &4)));
assert_eq!(iter.next(), Some((&2, &5)));
assert_eq!(iter.next(), Some((&3, &6)));
assert_eq!(iter.next(), None);
```

`zip()` is often used to zip an infinite iterator to a finite one.
This works because the finite iterator will eventually return [`None`],
ending the zipper. Zipping with `(0..)` can look a lot like [`enumerate`]:

```
let enumerate: Vec<_> = "foo".chars().enumerate().collect();

let zipper: Vec<_> = (0..).zip("foo".chars()).collect();

assert_eq!((0, 'f'), enumerate[0]);
assert_eq!((0, 'f'), zipper[0]);

assert_eq!((1, 'o'), enumerate[1]);
assert_eq!((1, 'o'), zipper[1]);

assert_eq!((2, 'o'), enumerate[2]);
assert_eq!((2, 'o'), zipper[2]);
```

If both iterators have roughly equivalent syntax, it may be more readable to use [`zip`]:

```
use std::iter::zip;

let a = [1, 2, 3];
let b = [2, 3, 4];

let mut zipped = zip(
    a.into_iter().map(|x| x * 2).skip(1),
    b.into_iter().map(|x| x * 2).skip(1),
);

assert_eq!(zipped.next(), Some((4, 6)));
assert_eq!(zipped.next(), Some((6, 8)));
assert_eq!(zipped.next(), None);
```

compared to:

```
# let a = [1, 2, 3];
# let b = [2, 3, 4];
#
let mut zipped = a
    .into_iter()
    .map(|x| x * 2)
    .skip(1)
    .zip(b.into_iter().map(|x| x * 2).skip(1));
#
# assert_eq!(zipped.next(), Some((4, 6)));
# assert_eq!(zipped.next(), Some((6, 8)));
# assert_eq!(zipped.next(), None);
```

[`enumerate`]: Iterator::enumerate
[`next`]: Iterator::next
[`zip`]: crate::iter::zip

2:3283:56364.docs:
Provides type based access to context intended for error reports.

Used in conjunction with [`Demand::provide_value`] and [`Demand::provide_ref`] to extract
references to member variables from `dyn Error` trait objects.

# Example

```rust
#![feature(provide_any)]
#![feature(error_generic_member_access)]
use core::fmt;
use core::any::Demand;

#[derive(Debug)]
struct MyBacktrace {
    // ...
}

impl MyBacktrace {
    fn new() -> MyBacktrace {
        // ...
        # MyBacktrace {}
    }
}

#[derive(Debug)]
struct SourceError {
    // ...
}

impl fmt::Display for SourceError {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Source Error")
    }
}

impl std::error::Error for SourceError {}

#[derive(Debug)]
struct Error {
    source: SourceError,
    backtrace: MyBacktrace,
}

impl fmt::Display for Error {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Error")
    }
}

impl std::error::Error for Error {
    fn provide<'a>(&'a self, demand: &mut Demand<'a>) {
        demand
            .provide_ref::<MyBacktrace>(&self.backtrace)
            .provide_ref::<dyn std::error::Error + 'static>(&self.source);
    }
}

fn main() {
    let backtrace = MyBacktrace::new();
    let source = SourceError {};
    let error = Error { source, backtrace };
    let dyn_error = &error as &dyn std::error::Error;
    let backtrace_ref = dyn_error.request_ref::<MyBacktrace>().unwrap();

    assert!(core::ptr::eq(&error.backtrace, backtrace_ref));
}
```

2:13729:54917.docs:
Returns a mutable, unchecked subslice of `str`.

This is the unchecked alternative to indexing the `str`.

# Safety

Callers of this function are responsible that these preconditions are
satisfied:

* The starting index must not exceed the ending index;
* Indexes must be within bounds of the original slice;
* Indexes must lie on UTF-8 sequence boundaries.

Failing that, the returned string slice may reference invalid memory or
violate the invariants communicated by the `str` type.

# Examples

```
let mut v = String::from("");
unsafe {
    assert_eq!("", v.get_unchecked_mut(0..4));
    assert_eq!("", v.get_unchecked_mut(4..7));
    assert_eq!("", v.get_unchecked_mut(7..11));
}
```

